import { Link } from "react-router-dom";
import { BackgroundBeams } from "./ui/BackgroundBeams";

export default function QuestionList() {
  return (
    <>
      <BackgroundBeams />
      <div
        style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%, -50%)",
        }}
      >
        <div
          className="loader"
          style={{ margin: "10px 0", display: "none" }}
        ></div>
        <div>
        <ul
          style={{
            listStyle: "none",
            color: "white",
            fontWeight: "bolder",
            lineHeight: "30px",
          }}
        >
          <div
            style={{
              color: "white",
              fontWeight: "bolder",
              textAlign: "left",
              marginBottom: "15px",
            }}
          >
            질문 01 - 평행세계에서 당신이 전혀 다른 직업을 가졌다면
            어떤 직업을 가지고 있을까요?
          </div>
          <li
            style={{
              border: "1px solid white",
              marginBottom: "15px",
              padding: "5px",
            }}
          >
            예술가
          </li>
          <li
            style={{
              border: "1px solid white",
              marginBottom: "15px",
              padding: "5px",
            }}
          >
            과학자
          </li>
          <li
            style={{
              border: "1px solid white",
              marginBottom: "15px",
              padding: "5px",
            }}
          >
            탐험가
          </li>
          <li
            style={{
              border: "1px solid white",
              marginBottom: "15px",
              padding: "5px",
            }}
          >
            교육자
          </li>
          <li
            style={{
              border: "1px solid white",
              marginBottom: "15px",
              padding: "5px",
            }}
          >
            기업가
          </li>
        </ul>
        <div style={{ padding: "5px" }}>
          <Link to="/question">
            <button
              style={{
                width: "87px",
                height: "27px",
                background: "white",
                color: "#ff9ae2",
                border: "none",
                borderRadius: "6px",
                cursor: "pointer",
                fontWeight: "bolder",
              }}
            >
              다음
            </button>
          </Link>
        </div>
        </div>


      </div>
    </>
  );
}
